import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './styling/LabSearch.css';
import search from '../icons/search.png';
import user from '../icons/person.png';
import ProfessorDetailsModal from './LabDetailsModal';

const majors = {
  "Mathematics": ["Graph Theory", "Algebra", "Calculus"],
  "Computer Science": ["Artificial Intelligence", "Machine Learning", "Software Engineering"],
  "Physics": ["Quantum Mechanics", "Thermodynamics", "Astrophysics"],
  "Biology": ["Genetics", "Microbiology", "Ecology"],
  "Chemistry": ["Organic Chemistry", "Inorganic Chemistry", "Physical Chemistry"]
};

const LabSearch = () => {
  const token = localStorage.getItem('token');
  const headers = {};
  if (token) {
      headers['Authorization'] = `Bearer ${token}`;
  }

  const LAB_URL = '/api/labs';
  const USER_URL = '/api/users';
  const FILE_URL = '/api/uploads';
  const APP_URL = '/api/applications';

  const [profs, setProfs] = useState([]);
  const [labs, setLabs] = useState([]);
  const [filteredLabs, setFilteredLabs] = useState([]);
  const [selectedLab, setSelectedLab] = useState(null);
  const [selectedMajor, setSelectedMajor] = useState('');

  useEffect(() => {
    const controller = new AbortController();
    const fetchUsers = async () => {
      try {
        const response = await axios.get(`${USER_URL}/all`, {
          signal: controller.signal,
          headers: headers,
        });
        const profs = response.data.users.filter(user => user.type === 'professor');

        const profWithPictures = await Promise.all(
          profs.map(async prof => {
            let newProfilePic = null;

            if (prof.profile_pic) {
              const pictureResponse = await axios.get(`${FILE_URL}/pictures/${prof.profile_pic}`, {
                signal: controller.signal,
                headers: headers,
              });
              newProfilePic = pictureResponse.data.picture;
            }
            return {
              ...prof,
              profile_pic: newProfilePic,
            };
          })
        );

        setProfs(profWithPictures);
      } catch (error) {
        console.error('Error fetching all labs:', error);
      }
    }

    const fetchLabs = async () => {
      try {
        const response = await axios.get(`${LAB_URL}`, {
          signal: controller.signal,
          headers: headers,
        });
        setLabs(response.data.labs);
        setFilteredLabs(response.data.labs);
      } catch (error) {
        console.error('Error fetching all labs:', error);
      }
    };

    fetchUsers();
    fetchLabs();

    return () => {
      controller.abort();
    };
  }, []);

  const handleMajorChange = (event) => {
    setSelectedMajor(event.target.value);
  };

  const handleSearch = async (event) => {
    event.preventDefault();
    const formData = new FormData(event.target);
    const searchData = {
      majorName: formData.get('majorName'),
      submajor: formData.get('submajor'),
      masters: formData.get('masters') === 'on',
      english: formData.get('english') === 'on',
      paid: formData.get('paid') === 'on',
    };

    setFilteredLabs(labs.filter(lab => 
      (searchData.majorName !== "" ? lab.major === searchData.majorName : true) &&
      (searchData.submajor !== "" ? lab.submajor === searchData.submajor : true ) &&
      ( lab.masters === searchData.masters ) &&
      (searchData.english ? lab.language === 'English' : true) &&
      (searchData.paid ? lab.salary > 0 : true)
    ));

    // try {
    //   const response = await axios.post('/api/search/searchLabs', searchData);
    //   setLabs(response.data);
    // } catch (error) {
    //   console.error('Error searching labs:', error);
    // }

  };

  const handleLabClick = async (labId) => {
    setSelectedLab(labs.filter(lab => lab._id === labId)[0]);
  };

  const closeModal = () => {
    setSelectedLab(null);
  };

  const handleApply = async (profId) => {
    //application + 1
    try {
      const response = await axios.post(`${APP_URL}`, {profId}, {
        headers: headers,
      });
      console.log(response.data)
      closeModal();
    } catch (error) {
      console.error('Error submitting application:', error);
    }
  }

  return (
    <div className="LabSearch-wrapper">
      <div className='searchLabs'>
        <div className='search'>
          <form className="searchForm" name='searchForm' id='search' onSubmit={handleSearch}>
            <div className='major'>
              <select name='majorName' id='majorName' onChange={handleMajorChange}>
                <option value="">Major</option>
                {Object.keys(majors).map(major => (
                  <option key={major} value={major}>{major}</option>
                ))}
              </select>
              <select name='submajor' id='submajor'>
                <option value="">Major Subcategory</option>
                {selectedMajor && majors[selectedMajor].map(submajor => (
                  <option key={submajor} value={submajor}>{submajor}</option>
                ))}
              </select>
            </div>
            <div className='options'>
              <div className='checkbox-container'>
                <label><p>Masters continuation required</p></label>
                <input type='checkbox' id='masters' name='masters'></input>
              </div>
              <div className='checkbox-container'>
                <label><p>Possible to work in English</p></label>
                <input type='checkbox' id='english' name='english'></input>
              </div>
              <div className='checkbox-container'>
                <label><p>Paid</p></label>
                <input type='checkbox' id='paid' name='paid'></input>
              </div>
            </div>
            <div className='searchIcon'>
              <button type="submit">
                <img className='searchIconButton' src={search} alt='search icon' />
              </button>
            </div>
          </form>
        </div>
        <hr className='solid'></hr>
        <div className='results'>
          <ul id='list-container'>
            {filteredLabs.map(lab => (
              <li key={lab._id}>
                <img src={
                  profs.filter(prof => prof.labId === lab._id)[0].profile_pic || user
                } alt='profile pic of professor'></img>
                <div className="labDetails">
                  <p>{lab.major}</p>
                  <p>{lab.submajor}</p>
                  <p>{lab.name}</p>
                </div>
                <div className="labInfo">
                  <p>{lab.description}</p>
                </div>
                <div className="specificInfo one">
                  <p>Masters Continuation</p>
                  <p>{lab.masters ? 'Mandatory' : 'Optional'}</p>
                  <p>Language</p>
                  <p>{lab.language}</p>
                </div>
                <div className="specificInfo two">
                  <p>Slots Available</p>
                  <p>{lab.openSlots}/{lab.maxSlots}</p>
                  <p>Salary</p>
                  <p>{lab.salary}</p>
                </div>
                <button className="toggle" aria-expanded="false" onClick={() => handleLabClick(lab._id)}></button>
              </li>
            ))}
          </ul>
        </div>
      </div>
      {selectedLab && (
        <ProfessorDetailsModal 
          lab={selectedLab} 
          prof = {profs.filter(prof => prof.labId === selectedLab._id)[0]} 
          onClose={closeModal}
          onApply = {() => handleApply(profs.filter(prof => prof.labId === selectedLab._id)[0].userId)} />
      )}
    </div>
  );
}

export default LabSearch;
